import './HomePage.scss';

function HomePage() {
    return (
        <article className="home-page">
            <h3 className="home-page__quote">I am a full-stack web developer, currently based in Kamloops, BC.</h3>
            <p className="home-page__text">My toolbox includes React, JavaScript, HTML, CSS, Sass, Node, Express & MySQL. I am passionate about action sports and the outdoors.</p>
            <div className="home-page__buttons">
                <button className="home-page__btn">Learn More</button>
                <button className="home-page__btn">See Projects</button>
            </div>
        </article>
    );
}

export default HomePage;
